pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract Supply{
mapping(uint => Manager) Manager_map;
mapping(uint => Product) Product_map;
address owner = msg.sender;
address customer = msg.sender;
mapping(uint => customers) Customer_map;

bool manager_loggedin;
bool customer_loggedin;

struct Manager{
    string username;
    string password;
    address owner;
    
}
struct Product{
    uint deviceid;
    address owner;
    string product;
    uint quality;
    string latitude;
    string longitude;
}
    
struct customers{
        uint id;
        address customer_owner;
        uint deviceid;
        string username;
        string password;
    }
    
    event isLoggedin(bool _isloggedin);
    uint customerindex;
    customers [] public customer_list;

event Loggedin(bool loggedin); 

uint mangerindex;
Product [] public product_list;
Manager [] public new_list;

modifier is_manager_loggedin{
    require(manager_loggedin == true, "Manager - Password and username is correct..");
    _;
    }
    
modifier is_customer_loggedin{
    require(customer_loggedin == true, "Customer - Password and username is correct..");
    _;
    }


function log_in_manager(string memory _username, string memory _password) public payable returns(bool){
    for(uint i = 0; i < new_list.length; i++){
        if(keccak256(bytes(Manager_map[i].username)) == keccak256(bytes(_username)) && 
        keccak256(bytes(Manager_map[i].password)) == keccak256(bytes(_password))
        ){
            manager_loggedin = true;
            emit Loggedin(manager_loggedin);
        }
        else{
            manager_loggedin = false;
        }
    }
    
    return manager_loggedin;
}

function log_in_customer(string memory _username, string memory _password) public payable returns(bool){
    for(uint i = 0; i < customer_list.length; i++){
        if(keccak256(bytes(Customer_map[i].username)) == keccak256(bytes(_username)) && 
        keccak256(bytes(Customer_map[i].password)) == keccak256(bytes(_password))
        ){
            customer_loggedin = true;
        }
        else{
            customer_loggedin = true;
        }
    }
    emit isLoggedin(customer_loggedin);
    return customer_loggedin;
}

function create_manager(string memory _username, string memory _password) public {
    Manager storage m = Manager_map[mangerindex];
    m.owner = owner;
    m.username = _username;
    m.password = _password;
    new_list.push(m);
}

function create_product(uint _deviceid, string memory _product, uint _quality, string memory _latitude, string memory _longitude) is_manager_loggedin public {
    Product storage p = Product_map[mangerindex];
    p.deviceid = _deviceid;
    p.owner = owner;
    p.product = _product;
    p.quality = _quality;
    p.latitude = _latitude;
    p.longitude = _longitude;
    product_list.push(p);
}

function get_index_manager(uint _id) is_manager_loggedin public view returns(Manager memory){
    Manager memory m = new_list[_id];
    return (m);
}

function get_index_product(uint _id) public view returns(Product memory){
    Product memory p = product_list[_id];
    return (p);
}
    
    function create_customer(uint _id, uint _deviceid, string memory _username, string memory _password) public{
        customers storage c = Customer_map[customerindex];
        c.id = _id;
        c.customer_owner = customer;
        c.deviceid = _deviceid;
        c.username = _username;
        c.password = _password;
        customer_list.push(c);
    }

}
